import React from "react";
import { Button } from "react-bootstrap";
import Select from "react-dropdown-select";

export default function GamePageLoggedInView() {
  // const wordLength =["3","4","5","6","7"];

  return (
    <>
      <div className="justify-content-center d-flex w-100 vh-100 bg-white text-dark">
        <div className="w-50 mt-5">
          <h1>Select word length</h1>
          <select className="form-control">
            <option>Word length</option>
            <option value="3">3</option>
            <option value="4">4</option>
            <option value="5">5</option>
            <option value="6">6</option>
            <option value="6">7</option>
          </select>
          <Button className="buttonStyle"> Start Game</Button>
        </div>
      </div>
    </>
  );
}
